import './InfoCard.css';

function InfoCard(props) {
  return (
    <div className="Card">
        <p className="blurb">
        <span className="first">A</span>spiring software developer with an interest in front-end.
        I have experience building intuitive, sleek and accessible UIs with React.
        I’ve had four great internships where I’ve done everything from developing modern <a href="https://course.studio/" >online learning experiences</a> to implementing web
        accessibility on an <a href="https://www.achievers.com/company/" >employee engagement platform.</a> I’m looking to continue expanding my horizons and making an impact.
        Currently looking for internship opportunities for May - Aug 2022.
        Graduating from the University of Waterloo in 2023.
        </p>
        <a href="../public/resume.pdf" className="resume" download>Learn more about me</a>
    </div>
  );
}

export default InfoCard;
